CREATE DATABASE QuanLyNhaTro
ON PRIMARY(
	NAME=QuanLyNhaTro,
	FILENAME='D:\DB\QuanLyNhaTro.mdf',
	SIZE=10MB,
	MAXSIZE=unlimited,
	FILEGROWTH=20%
)
LOG ON(
	NAME=QuanLyNhaTroLog,
	FILENAME='D:\DB\QuanLyNhaTro.ldf',
	SIZE=5MB,
	MAXSIZE=unlimited,
	FILEGROWTH=1MB
)

use QuanLyNhaTro

create table SinhVien(
maSV nvarchar(8) primary key,
hoTen nvarchar(50) not null,
lop nvarchar(20) not null,
queQuan nvarchar(50) not null,
nganh nvarchar(50) not null,
diaChi nvarchar(50) not null
)

create table NhaTro(
diaChi nvarchar(50) primary key,
chuNha nvarchar(50) not null,
soDT nvarchar(11) not null,
)

alter table SinhVien 
add constraint FK_dcTro foreign key(diaChi) references NhaTro(diaChi)

